import React from 'react';
import UserInfo from './Components/UserInfo';
import Statistics from './Components/Statistics';
import Messages from './Components/Messages';
import './index.css'; // Import global CSS

function App() {
  // User data
  const user = {
    name: "John Doe",
    email: "john.doe@example.com",
    role: "Admin",
    profilePicture: "https://via.placeholder.com/150" // Placeholder image URL
  };

  // Statistics data
  const statistics = {
    totalUsers: 1200,
    activeUsers: 900,
    newSignups: 150,
    activePercentage: (900 / 1200) * 100 // Active users percentage calculation
  };

  // Messages data
  const messages = [
    "Your profile has been updated successfully.",
    "You have 3 new notifications.",
    "A new project has been assigned to you."
  ];

  return (
    <div className="App">
      <h1>Dashboard</h1>
      <div className="dashboard">
        {/* Pass user data to UserInfo component */}
        <UserInfo user={user} />

        {/* Pass statistics data to Statistics component */}
        <Statistics statistics={statistics} />

        {/* Pass messages to Messages component */}
        <Messages messages={messages} />
      </div>
    </div>
  );
}

export default App;
